import Layout from '../components/Layout'



const Index = (props) =>{
    return(
        <Layout activeClass={props.url.pathname}>
            <_banner/>
        </Layout>
    )
}

const _banner = () =>{
    return (
        <div className="banner">
            <div className="bg-banner">
                <div className="container">
                    <div className="row">
                        <div className="col-md mt-3 text-center">
                            <h2><b>Bootcamp? Yuk langsung ke <br/>NooBee<span>Camp</span> aja</b></h2>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}


export default Index;
